import React, {lazy, Suspense} from "react";

import {
  BrowserRouter as Router,
  Switch,
  Route

} from "react-router-dom";

import PopularPage from '../pages/populars/index';
import UpcomingPage from '../pages/upcoming/index';
import SearchPage from '../pages/search/index';
import FavoritePage from '../pages/favorites/index';


const RouteMovies =  () => {
    return (
        <Router>
            <Switch>
                <Route path="/" exact>
                    <PopularPage/>
                </Route>
                <Route path="/popular-movies" exact>
                    <PopularPage/>
                </Route>
                <Route path="/upcoming-movies" exact>
                    <UpcomingPage/>
                </Route>
                <Route path="/search-movies" exact>
                    <SearchPage/>
                </Route>
                <Route path="/favorite-movies" exact>
                    <FavoritePage/>
                </Route>
            </Switch>
        </Router>
    )
}

export default React.memo(RouteMovies);
